sys_variable_value.value:
(function execute(inputs, outputs) {

  // Pass days_ago value into gs.daysAgo() method to get date
  // This will get the date based from days ago from the current date
  // Example: Current date > 12/28    Output date > 12/22
  outputs.new_date = gs.daysAgo(inputs.days_ago);

})(inputs, outputs);

